article_content:
그 가격다워요;

조립도 엉망이고 벌어지고 환불 하려다 귀찮고 오래걸려서 그냥 쓰네요

그냥 쓰.레.기

크기가 작다는 후기를 보고 산거라서 크기는 나름 괜찮았는데요
받고 박스 겉면이 저렇게 움푹 파여있길래 설마 했는데 안에 제품까지 파여있네요;
크기는 작은데 엄청 무거워서 교환하는게 더 힘들 것 같아서 그냥 쓰는데요,
겉 박스 개봉하니까 바로 본 제품이 나오던데 가구 제품인데 스티로폼 하나라도 넣으셔야 하는거 아닌가요?
칼질 조금만 더 강하게 했으면 제품도 같이 잘랐겠어요;

좋아용!! 안에 공간이 좀 마니 좁아요 생각보다

그리고 조립이 미 완성 되어서... 제가 나사로 더 박앗아요^^;;;

구매하시는 분들 한번 안쪽 잘 살피세용!!
